#include <stdio.h>
#include <vector>
#include <string>
using namespace std;

vector<int> parse_nested_parens(string paren_string) {
    vector<int> maxLevels;
    size_t start = 0;
    size_t end = paren_string.find(' ');

    while (end != string::npos) {
        string group = paren_string.substr(start, end - start);
        int currentLevel = 0;
        int maxLevel = 0;

        for (char c : group) {
            if (c == '(') {
                currentLevel++;
                maxLevel = max(maxLevel, currentLevel);
            } else if (c == ')') {
                currentLevel--;
            }
        }

        maxLevels.push_back(maxLevel);
        start = end + 1;
        end = paren_string.find(' ', start);
    }

    // Process the last group
    string lastGroup = paren_string.substr(start);
    int currentLevel = 0;
    int maxLevel = 0;

    for (char c : lastGroup) {
        if (c == '(') {
            currentLevel++;
            maxLevel = max(maxLevel, currentLevel);
        } else if (c == ')') {
            currentLevel--;
        }
    }

    maxLevels.push_back(maxLevel);

    return maxLevels;
}

