std::string string_xor(std::string a, std::string b) {
    if (a.length() != b.length()) {
        return "Error: Input strings must be of the same length";
    }

    std::string result = "";
    for (int i = 0; i < a.length(); i++) {
        if (a[i] == b[i]) {
            result += "0";
        } else {
            result += "1";
        }
    }

    return result;
}

