float mean_absolute_deviation(vector<float> numbers){
    // Calculate Mean
    float mean = 0;
    for (float num : numbers) {
        mean += num;
    }
    mean /= numbers.size();

    // Calculate Absolute Deviation
    vector<float> abs_diff;
    for (float num : numbers) {
        abs_diff.push_back(abs(num - mean));
    }

    // Calculate Mean Absolute Deviation
    float sum_abs_diff = 0;
    for (float diff : abs_diff) {
        sum_abs_diff += diff;
    }
    float mean_abs_deviation = sum_abs_diff / numbers.size();

    return mean_abs_deviation;
}

