using namespace std;

## Chain of thought:
1. Initialize an empty vector of strings to store the separated groups.
2. Initialize two variables to keep track of the start and end indices of each group.
3. Iterate through the input string character by character.
4. When an opening parenthesis is encountered, mark the start index.
5. When a closing parenthesis is encountered, mark the end index and extract the substring between the start and end indices.
6. Add the extracted substring to the vector of strings.
7. Continue this process until the end of the input string is reached.
8. Return the vector of separated groups.

## Pseudocode:

#undef NDEBUG
#include<assert.h>
bool issame(vector<string> a,vector<string>b){
    if (a.size()!=b.size()) return false;
    for (int i=0;i<a.size();i++)
    {
    if (a[i]!=b[i]) return false;
