vector<float> rescale_to_unit(vector<float> numbers){
    float minVal = numbers[0];
    float maxVal = numbers[0];

    for (float num : numbers) {
        if (num < minVal) {
            minVal = num;
        }
        if (num > maxVal) {
            maxVal = num;
        }
    }

    float range = maxVal - minVal;
    vector<float> rescaledValues;

    for (float num : numbers) {
        float rescaled = (num - minVal) / range;
        rescaledValues.push_back(rescaled);
    }

    return rescaledValues;
}

