string sort_numbers(string numbers) {
    // Step 1: Split the input string into individual number words
    vector<string> numberWords;
    string currentWord = "";
    for (char c : numbers) {
        if (c == ' ') {
            numberWords.push_back(currentWord);
            currentWord = "";
        } else {
            currentWord += c;
        }
    }
    numberWords.push_back(currentWord);

    // Step 2: Create a map to store the mapping of number words to numerical values
    map<string, int> wordToNumber = {
        {"zero", 0}, {"one", 1}, {"two", 2}, {"three", 3},
        {"four", 4}, {"five", 5}, {"six", 6}, {"seven", 7},
        {"eight", 8}, {"nine", 9}
    };

    // Step 3: Convert the number words to numerical values
    vector<int> numericValues;
    for (string word : numberWords) {
        numericValues.push_back(wordToNumber[word]);
    }

    // Step 4: Sort the numerical values in ascending order
    sort(numericValues.begin(), numericValues.end());

    // Step 5: Convert the sorted numerical values back to number words
    vector<string> sortedWords;
    for (int num : numericValues) {
        for (auto it : wordToNumber) {
            if (it.second == num) {
                sortedWords.push_back(it.first);
                break;
            }
        }
    }

    // Step 6: Join the sorted number words into a single string
    string sortedString = "";
    for (string word : sortedWords) {
        sortedString += word + " ";
    }
    sortedString.pop_back(); // Remove the extra space at the end

    // Step 7: Return the sorted string
    return sortedString;
}

