using namespace std;

double poly(vector<double> xs, double x){
    double sum = 0;
    for (int i = 0; i < xs.size(); i++) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double poly_derivative(vector<double> xs, double x){
    double derivative_sum = 0;
    for (int i = 1; i < xs.size(); i++) {
        derivative_sum += i * xs[i] * pow(x, i - 1);
    }
    return derivative_sum;
}

double find_zero(vector<double> xs){
    if (xs.size() % 2 != 0 || xs.empty()) {
        return 0.0;  // Invalid input
    }

    double x = 0.0;  // Initial guess for the zero point
    while (true) {
        double x_next = x - poly(xs, x) / poly_derivative(xs, x);  // Newton's method
        if (abs(x_next - x) < 1e-6) {  // Convergence criteria
            return x_next;
        }
        x = x_next;
    }
}

