double find_zero(vector<double> xs){
    if (xs.size() % 2 != 0 || xs.back() == 0) {
        return 0;
    }

    // Find the derivative of the polynomial
    vector<double> derivative;
    for (int i = 1; i < xs.size(); i++) {
        derivative.push_back(xs[i] * i);
    }

    // Use Newton's method to find the root
    double x = 1.0; // Initial guess
    while (true) {
        double fx = poly(xs, x);
        double f_prime_x = poly(derivative, x);
        double new_x = x - fx / f_prime_x;
        if (abs(new_x - x) < 0.0001) {
            break;
        }
        x = new_x;
    }

    return x;
}

