bool will_it_fly(vector<int> q, int w){
    bool isPalindrome = true;
    int sum = 0;

    for (int i = 0; i < q.size()/2; i++) {
        if (q[i] != q[q.size()-1-i]) {
            isPalindrome = false;
            break;
        }
    }

