int smallest_change(vector<int> arr){
    if (arr.size() <= 1) {
        return 0;
    }
    int changes = 0;
    int start = 0;
    int end = arr.size() - 1;
    while (start < end) {
        if (arr[start] != arr[end]) {
            changes++;
            if (arr[start] < arr[end]) {
                arr[start] = arr[end];
            } else {
                arr[end] = arr[start];
            }
        }
        start++;
        end--;
    }
    return changes;
}

