bool is_prime(int n) {
    if (n <= 1) return false;
    for (int i = 2; i * i <= n; i++) {
        if (n % i == 0) return false;
    }
    return true;
}

bool is_multiply_prime(int a) {
    if (a < 6) return false;
    if (a % 2 == 0 || a % 3 == 0) return false;
    for (int i = 2; i < 100; i++) {
        if (is_prime(i)) {
            for (int j = i + 1; j < 100; j++) {
                if (is_prime(j)) {
                    for (int k = j + 1; k < 100; k++) {
                        if (is_prime(k) && i * j * k == a) {
                            return true;
                        }
                    }
                }
            }
        }
    }
    return false;
}

