    if (a < 6) {
        return false;
    }
    if (a % 2 == 0) {
        if (a == 6) {
            return false;
        } else {
            return isPrime(a / 2);
        }
    }
    for (int i = 2; i < 100; i++) {
        if (isPrime(i)) {
            for (int j = i + 1; j < 100; j++) {
                if (isPrime(j)) {
                    for (int k = j + 1; k < 100; k++) {
                        if (isPrime(k) && i * j * k == a) {
                            return true;
                        }
                    }
                }
            }
        }
    }
    return false;
}

