## Chain of thought:
1. **Counting n-digit numbers starting with 1**:
    - For an n-digit number starting with 1, the first digit is fixed as 1, and the remaining n-1 digits can be any digit from 0 to 9.
    - So, the total count of n-digit numbers starting with 1 is 9 * 10^(n-1) (as the first digit can't be 0).
2. **Counting n-digit numbers ending with 1**:
    - For an n-digit number ending with 1, the last digit is fixed as 1, and the remaining n-1 digits can be any digit from 0 to 9.
    - So, the total count of n-digit numbers ending with 1 is 10^(n-1) (as the last digit can be 1-9).
3. **Total count**:
    - To get the total count of n-digit numbers that start or end with 1, we sum the counts obtained from steps 1 and 2.
4. **Pseudocode**:
    - Initialize a variable `count` to 0.
    - Calculate the count of n-digit numbers starting with 1: `9 * pow(10, n-1)`.
    - Calculate the count of n-digit numbers ending with 1: `pow(10, n-1)`.
    - Add the counts obtained above to `count`.
    - Return `count`.

