int is_bored(string S){
    int boredomCount = 0;
    string delimiter = ".?!";
    size_t pos = 0;
    string token;
    while ((pos = S.find_first_of(delimiter)) != string::npos) {
        token = S.substr(0, pos);
        if (token.substr(0, 2) == "I ") {
            boredomCount++;
        }
        S.erase(0, pos + 1);
    }
    if (S.substr(0, 2) == "I ") {
        boredomCount++;
    }
    return boredomCount;
}

