vector<int> unique_digits(vector<int> x){
    vector<int> output;
    for (int num : x) {
        bool flag = true;
        int temp = num;
        while (temp > 0) {
            int digit = temp % 10;
            if (digit % 2 == 0) {
                flag = false;
                break;
            }
            temp /= 10;
        }
        if (flag) {
