using namespace std;

int max_fill(vector<vector<int>> grid, int capacity) {
    int total_count = 0;
    for (vector<int> well : grid) {
        int water_level = 0;
        for (int water : well) {
            water_level += water;
        }
        if (water_level > capacity) {
            int count = ceil((double)water_level / capacity);
            total_count += count;
        }
    }
    return total_count;
}

