using namespace std;
vector<int> tri(int n){
    vector<int> tribonacci = {};
    if (n == 0) {
        tribonacci.push_back(0);
        return tribonacci;
    } else if (n == 1) {
        tribonacci = {0, 1};
        return tribonacci;
    } else if (n == 2) {
        tribonacci = {0, 1, 1};
        return tribonacci;
    } else {
        tribonacci = {0, 1, 1};
        for (int i = 3; i <= n; i++) {
            if (i % 2 == 0) {
                tribonacci.push_back(1 + i / 2);
            } else {
                tribonacci.push_back(tribonacci[i - 1] + tribonacci[i - 2] + tribonacci[i + 1]);
            }
        }
        return tribonacci;
    }
}

