using namespace std;

vector<int> largest_smallest_integers(vector<int> lst){
    int largest_negative = INT_MIN;
    int smallest_positive = INT_MAX;

    for (int element : lst) {
        if (element < 0 && element > largest_negative) {
            largest_negative = element;
        } else if (element > 0 && element < smallest_positive) {
            smallest_positive = element;
        }
    }

    return {largest_negative == INT_MIN ? 0 : largest_negative, smallest_positive == INT_MAX ? 0 : smallest_positive};
}

