boost::any compare_one(boost::any a, boost::any b) {
    if (a.type() == b.type()) {
        if (a.type() == typeid(int)) {
            return boost::any_cast<int>(a) > boost::any_cast<int>(b) ? a : b;
        } else if (a.type() == typeid(float)) {
            return boost::any_cast<float>(a) > boost::any_cast<float>(b) ? a : b;
        } else if (a.type() == typeid(std::string)) {
            return boost::any_cast<std::string>(a) > boost::any_cast<std::string>(b) ? a : b;
        }
    } else {
        if (a.type() == typeid(int) && b.type() == typeid(float)) {
            return boost::any_cast<int>(a) > boost::any_cast<float>(b) ? a : b;
        } else if (a.type() == typeid(float) && b.type() == typeid(int)) {
            return boost::any_cast<float>(a) > boost::any_cast<int>(b) ? a : b;
        } else if (a.type() == typeid(std::string) && b.type() == typeid(int)) {
            return std::stof(boost::any_cast<std::string>(a)) > boost::any_cast<int>(b) ? a : b;
        } else if (a.type() == typeid(int) && b.type() == typeid(std::string)) {
            return boost::any_cast<int>(a) > std::stof(boost::any_cast<std::string>(b)) ? a : b;
        } else if (a.type() == typeid(std::string) && b.type() == typeid(float)) {
            return std::stof(boost::any_cast<std::string>(a)) > boost::any_cast<float>(b) ? a : b;
        } else if (a.type() == typeid(float) && b.type() == typeid(std::string)) {
            return boost::any_cast<float>(a) > std::stof(boost::any_cast<std::string>(b)) ? a : b;
        }
    }
    return "None";
}

#undef NDEBUG
#include<assert.h>
