    string result = "";
    vector<string> words = splitSentence(sentence);
    for (string word : words) {
        if (isPrime(word.length())) {
            result += word + " ";
        }
    }
    if (!result.empty()) {
        result.pop_back(); // Remove the extra space at the end
    }
    return result;
}

