string Strongest_Extension(string class_name, vector<string> extensions){
    string strongestExtension = "";
    int maxStrength = INT_MIN;
    int maxIndex = -1;

    for (int i = 0; i < extensions.size(); i++) {
        int CAP = 0, SM = 0;
        for (char c : extensions[i]) {
            if (isupper(c)) CAP++;
            if (islower(c)) SM++;
        }
        int strength = CAP - SM;
        if (strength > maxStrength || (strength == maxStrength && i < maxIndex)) {
            maxStrength = strength;
            maxIndex = i;
        }
    }

    if (maxIndex != -1) {
        strongestExtension = class_name + "." + extensions[maxIndex];
    }

    return strongestExtension;
}

