std::vector<std::string> bf(std::string planet1, std::string planet2) {
    std::map<std::string, int> planetOrder = {
        {"Mercury", 1},
        {"Venus", 2},
        {"Earth", 3},
        {"Mars", 4},
        {"Jupiter", 5},
        {"Saturn", 6},
        {"Uranus", 7},
        {"Neptune", 8}
    };

    std::vector<std::string> planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
    std::vector<std::string> result;

    if (planetOrder.find(planet1) == planetOrder.end() || planetOrder.find(planet2) == planetOrder.end()) {
        return result;
    }

    int start = std::min(planetOrder[planet1], planetOrder[planet2]);
    int end = std::max(planetOrder[planet1], planetOrder[planet2]);

    for (int i = start + 1; i < end; i++) {
        result.push_back(planets[i - 1]);
    }

    std::sort(result.begin(), result.end(), [&](const std::string& a, const std::string& b) {
        return planetOrder[a] < planetOrder[b];
    });

    return result;
}

