void backtrack(vector<vector<int>>& grid, vector<int>& path, vector<vector<bool>>& visited, vector<int>& minPath, int steps) {
    if (steps == 0) {
        if (minPath.empty() || path < minPath) {
            minPath = path;
        }
        return;
    }

    int n = grid.size();
    int x = path.back() / n;
    int y = path.back() % n;

    visited[x][y] = true;

    vector<pair<int, int>> directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
    for (const auto& [dx, dy] : directions) {
        int nx = x + dx;
        int ny = y + dy;
        if (nx >= 0 && nx < n && ny >= 0 && ny < n && !visited[nx][ny]) {
            path.push_back(grid[nx][ny]);
            backtrack(grid, path, visited, minPath, steps - 1);
            path.pop_back();
        }
    }

    visited[x][y] = false;
}

