    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            path.push_back(grid[i][j]);
            backtrack(grid, path, visited, minPath, k - 1);
            path.pop_back();
        }
    }

    return minPath;
}

