using namespace std;
bool right_angle_triangle(float a, float b, float c){
    // Check if the given sides can form a triangle
    if (a + b <= c || a + c <= b || b + c <= a) {
        return false;
    }

    // Calculate the square of each side
    float a_square = a * a;
    float b_square = b * b;
    float c_square = c * c;

    // Sort the squares of the sides in ascending order
    float sides[3] = {a_square, b_square, c_square};
    sort(sides, sides + 3);

    // Check if it's a right-angled triangle using the Pythagorean theorem
    if (sides[0] + sides[1] == sides[2]) {
        return true;
    }

    return false;
}

